    // }, [product]) 

    const loadMenu = () => {
        restaurantService
            .getRestaurant()
            .then(response => setProduct(response.data.menu))
            .catch(err => console.log(err))

        console.log(product)
    }
//
    loadMenu()

    return (
        <>
            <ul> Lista de productos
            {
                product.map(elm => {
                    <li>{elm.name} {elm.price}</li>
                })
            }
            </ul>
        </>
    )
}

export default MenuList
